(121, '930aae19-117e-4739-9672-f8948913bc78', 1, 'Update', 'App\\Models\\Page', 1, 'App\\Models\\Page', 1, 'App\\Models\\Page', 1, '', 'finished', '', '2021-03-26 04:39:58', '2021-03-26 04:39:58', '{\"about_en_name\":\"test\",\"about_ar_name\":\"test\",\"about_en_details\":\"test\",\"about_ar_details\":\"test\"}', '{\"about_en_name\":\"We are a company built on dreams\",\"about_ar_name\":\"\\u0644\\u0642\\u062f \\u0642\\u0627\\u0645\\u062a \\u0634\\u0631\\u0643\\u062a\\u0646\\u0627 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645\",\"about_en_details\":\"And these dreams inspire us to create innovative products that enhance human mobility and benefit society. We see \\\"The Power of Dreams\\\" as a way of thinking that guides us and inspires us to move forward. The strength of our company comes from this philosophy\\u2014based on the visionary principles of our founder, Soichiro Honda.\\n\\u201cWouldn\\u2019t it be exciting if dream products really existed?\\u201d \\u201cWe can please many people if we create the products of their dreams!\\u201d At Honda we take on challenges in developing new products and technologies while cherishing the dreams and passion of each associate to create exciting and fun products that will bring joy to many people. Dreams are the source of our courage and energy to meet every challenge without fear of failure. Dreams are the major force that propels Honda. Through The Power of Dreams, Honda will continue providing new joys to the world\",\"about_ar_details\":\"\\u0648\\u062a\\u0644\\u0647\\u0645\\u0646\\u0627 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645 \\u0644\\u0625\\u064a\\u062c\\u0627\\u062f \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0627\\u0644\\u0627\\u0628\\u062a\\u0643\\u0627\\u0631\\u064a\\u0629 \\u0627\\u0644\\u062a\\u064a \\u062a\\u0639\\u0632\\u0632 \\u0627\\u0644\\u062d\\u0631\\u0643\\u0629 \\u0627\\u0644\\u0628\\u0634\\u0631\\u064a\\u0629 \\u0648\\u062a\\u0641\\u064a\\u062f \\u0627\\u0644\\u0645\\u062c\\u062a\\u0645\\u0639. \\u0648\\u0646\\u062d\\u0646 \\u0646\\u0631\\u0649 \\\"\\u0642\\u0648\\u0629 \\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645\\\" \\u0643\\u0633\\u0628\\u064a\\u0644 \\u0627\\u0644\\u062a\\u0641\\u0643\\u064a\\u0631 \\u0627\\u0644\\u0630\\u064a \\u064a\\u0648\\u062c\\u0647\\u0646\\u0627 \\u0648\\u064a\\u0644\\u0647\\u0645\\u0646\\u0627 \\u0644\\u0644\\u062a\\u0642\\u062f\\u0645 \\u0644\\u0644\\u0623\\u0645\\u0627\\u0645. \\u0648\\u062a\\u0623\\u062a\\u064a \\u0642\\u0648\\u0629 \\u0634\\u0631\\u0643\\u062a\\u0646\\u0627 \\u0645\\u0646 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0641\\u0644\\u0633\\u0641\\u0629\\u060c \\u0627\\u0633\\u062a\\u0646\\u0627\\u062f\\u0627\\u064b \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0628\\u0627\\u062f\\u0626 \\u0627\\u0644\\u062a\\u0635\\u0648\\u064a\\u0631\\u064a\\u0629 \\u0644\\u0645\\u0624\\u0633\\u0633\\u0646\\u0627\\u060c \\u0633\\u0648\\u064a\\u0634\\u064a\\u0631\\u0648 \\u0647\\u0648\\u0646\\u062f\\u0627.\\n\\u0623\\u0644\\u0646 \\u064a\\u0643\\u0648\\u0646 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u062b\\u064a\\u0631 \\u0623\\u0646 \\u0646\\u062c\\u0644\\u0628 \\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645 \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0648\\u0627\\u0642\\u0639\\u061f \\\"\\u0625\\u0646 \\u0628\\u0625\\u0645\\u0643\\u0627\\u0646\\u0646\\u0627 \\u0625\\u0633\\u0639\\u0627\\u062f \\u0627\\u0644\\u0639\\u062f\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0634\\u062e\\u0627\\u0635 \\u0625\\u0630\\u0627 \\u0623\\u0648\\u062c\\u062f\\u0646\\u0627 \\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0623\\u062d\\u0644\\u0627\\u0645\\u0646\\u0627!\\\" \\u0648\\u0646\\u062d\\u0646 \\u0641\\u064a \\u0647\\u0648\\u0646\\u062f\\u0627\\u060c \\u0646\\u062a\\u0648\\u0644\\u0649 \\u0627\\u0644\\u062a\\u062d\\u062f\\u064a \\u0627\\u0644\\u062e\\u0627\\u0635 \\u0628\\u062a\\u0637\\u0648\\u064a\\u0631 \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0648\\u0627\\u0644\\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0627\\u0644\\u062c\\u062f\\u064a\\u062f\\u0629\\u060c \\u0645\\u0639 \\u0625\\u062b\\u0631\\u0627\\u0621 \\u0623\\u062d\\u0644\\u0627\\u0645 \\u0648\\u0639\\u0648\\u0627\\u0637\\u0641 \\u0643\\u0644 \\u0634\\u0631\\u064a\\u0643 \\u0644\\u0625\\u064a\\u062c\\u0627\\u062f \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0627\\u0644\\u0645\\u062b\\u064a\\u0631\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0631\\u062d\\u0629 \\u0627\\u0644\\u062a\\u064a \\u0633\\u062a\\u0633\\u0639\\u062f \\u0627\\u0644\\u0639\\u062f\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0634\\u062e\\u0627\\u0635. \\u0648\\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645 \\u0647\\u064a \\u0645\\u0635\\u062f\\u0631 \\u0634\\u062c\\u0627\\u0639\\u062a\\u0646\\u0627 \\u0648\\u0637\\u0627\\u0642\\u062a\\u0646\\u0627 \\u0644\\u062a\\u0644\\u0628\\u064a\\u0629 \\u0643\\u0644 \\u062a\\u062d\\u062f\\u064a \\u062f\\u0648\\u0646 \\u0627\\u0644\\u062e\\u0648\\u0641 \\u0645\\u0646 \\u0627\\u0644\\u0641\\u0634\\u0644. \\u0648\\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645 \\u0647\\u064a \\u0623\\u064a\\u0636\\u0627\\u064b \\u0627\\u0644\\u0642\\u0648\\u0629 \\u0627\\u0644\\u0623\\u0633\\u0627\\u0633\\u064a\\u0629 \\u0627\\u0644\\u062a\\u064a \\u062a\\u062d\\u0641\\u0632 \\u0634\\u0631\\u0643\\u0629 \\u0647\\u0648\\u0646\\u062f\\u0627. \\u0648\\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0642\\u0648\\u0629 \\u0627\\u0644\\u0623\\u062d\\u0644\\u0627\\u0645\\u060c \\u0633\\u062a\\u0633\\u062a\\u0645\\u0631 \\u0647\\u0648\\u0646\\u062f\\u0627 \\u0641\\u064a \\u062a\\u0642\\u062f\\u064a\\u0645 \\u0623\\u0648\\u062c\\u0647 \\u0627\\u0644\\u0631\\u0627\\u062d\\u0629 \\u0627\\u0644\\u062c\\u062f\\u064a\\u062f\\u0629 \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645.\"}');
