 of environmental initiatives on a global basis. Facing such changes squarely, Honda has been strengthening and optimizing its global business operations in order to deliver good products with speed, affordability and low CO2 emissions to our customers in every region around the world. We will continue enhancing our unique corporate culture and pursue our uninterrupted challenge to share joys with people around the world through technologies, products and corporate activities unique to Honda.<\\/div>\\n<div class=\\\"msg\\\">&nbsp;<\\/div>\\n<div class=\\\"pos\\\">Takanobu Ito, President, CEO and Representative Director<br \\/>June 2013<\\/div>\\n<\\/div>\\n<\\/div>\\n<div class=\\\"ceo_set last\\\"><!-- pagebreak --><\\/div>\\n<div class=\\\"ceo_set last\\\">\\n<div id=\\\"about\\\" class=\\\"wrapper\\\">\\n<section class=\\\"under_box\\\">\\n<div class=\\\"ceo_set last\\\">\\n<div class=\\\"ceo_msg_set\\\">\\n<div class=\\\"msg\\\"><img style=\\\"margin: 20px; float: left;\\\" src=\\\"\\/storage\\/photos\\/1\\/605d8beb468a1.png\\\" alt=\\\"\\\" width=\\\"150\\\" height=\\\"150\\\" \\/><\\/div>\\n<div class=\\\"msg\\\">We, at Al-Futtaim, are dedicated to supplying Honda products of the highest quality, yet at a reasonable price for global Customer satisfaction. We live by our company mission statement of: \\\"Together we strive to be an outstanding Company achieving Customers for Life&rdquo;.<br \\/>This is built around six key values: to be welcoming, trustworthy, respectful, innovative, inspiring and ambitious. These core value are the basis upon which we have built and continue to build, such a successful business.<\\/div>\\n<div class=\\\"msg\\\">&nbsp;<\\/div>\\n<div class=\\\"pos\\\">Sherif Mahmoud<br \\/>General Manager<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<\\/div>\\n<section id=\\\"footer\\\" class=\\\"footer_set static\\\">\\n<div class=\\\"footer_main\\\">\\n<div class=\\\"footer_container\\\">&nbsp;<\\/div>\\n<\\/div>\\n<\\/section>\\n<\\/div>\