(134, '930ad257-7a51-4009-af6d-1f6d17221186', 1, 'Update', 'App\\Models\\Page', 1, 'App\\Models\\Page', 1, 'App\\Models\\Page', 1, '', 'finished', '', '2021-03-26 06:21:19', '2021-03-26 06:21:19', '{\"ar_ceo\":\"\",\"en_environment\":\"\",\"ar_environment\":\"\"}', '{\"ar_ceo\":\"<p>aaa<\\/p>\",\"en_environment\":\"<section class=\\\"under_box\\\">\\n<div class=\\\"blue_skies_set\\\">\\n<div class=\\\"blue_skies_data\\\">\\n<div class=\\\"paragraph pb20\\\"><img style=\\\"margin: 50px 100px; float: left;\\\" src=\\\"\\/storage\\/photos\\/1\\/605d967254d23.png\\\" alt=\\\"\\\" width=\\\"163\\\" height=\\\"138\\\" \\/>In 2010, Honda announced its direction for the decade leading up to 2020: to provide \\\"good products to customers with speed, affordability, and low CO2 emissions.\\\"<br \\/>The Honda Environmental and Safety Vision - to realize \\\"the joy and freedom of mobility and a sustainable society where people can enjoy life\\\" - was established based on this direction.<br \\/>Providing the joy and freedom of mobility has been Honda\'s aim in the development of personal mobility products since the company\'s founding. The joy of mobility is not just t he pleasure of driving your own car or motorcycle.<br \\/>It\'s also the excitement of making discoveries and realizing dreams through the freedom mobility provides. Realizing a sustainable society where people can enjoy life, on the other hand, will require us to focus corporate resources on addressing climate change and energy issues as top priorities.To realize the two components of our Environmental and Safety Vision, we will lead the industry in offering outstanding environmental and safety performance with products and technologies that proudly bear Honda\'s identity.<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<section class=\\\"honda_gallery\\\">\\n<div class=\\\"single_video_set\\\">\\n<div class=\\\"video_data_set\\\">\\n<div class=\\\"video_data\\\">&nbsp;<\\/div>\\n<div class=\\\"video_data\\\">&