(160, '930f70da-42aa-4192-8ad3-67bd9c5297c7', 1, 'Update', 'App\\Models\\Page', 1, 'App\\Models\\Page', 1, 'App\\Models\\Page', 1, '', 'finished', '', '2021-03-28 13:27:51', '2021-03-28 13:27:51', '{\"en_ceo\":\"<div class=\\\"ceo_set\\\">\\r\\n    <div class=\\\"ceo_msg_set\\\">\\r\\n        <div class=\\\"msg\\\"><img style=\\\"float: left; margin: 20px;\\\" src=\\\"\\/storage\\/photos\\/1\\/605d8b35e4fbc.png\\\" alt=\\\"\\\"\\r\\n                width=\\\"150\\\" height=\\\"150\\\" \\/>Sharing joys with people around the world Ever since the foundation of our\\r\\n            company, Honda associates have been demonstrating a challenging spirit, wanting to bring joy to people,\\r\\n            contribute to society with our technologies and create new products that people have never seen anywhere in\\r\\n            the world. With such a challenging spirit, we have been consistently pursuing the development of\\r\\n            technologies that are useful to people in their daily lives and products that please our customers. In\\r\\n            recent years, our business environment has been marked by significant changes, including the transformation\\r\\n            of the global economy and market structure as well as acceleration of environmental initiatives on a global\\r\\n            basis. Facing such changes squarely, Honda has been strengthening and optimizing its global business\\r\\n            operations in order to deliver good products with speed, affordability and low CO2 emissions to our\\r\\n            customers in every region around the world. We will continue enhancing our unique corporate culture and\\r\\n            pursue our uninterrupted challenge to share joys with people around the world through technologies, products\\r\\n            and corporate activities unique to Honda.<\\/div>\\r\\n        <div class=\\\"msg\\\">&nbsp;<\\/div>\\r\\n        <div class=\\\"pos\\\">Takanobu Ito, President, CEO and Representative Director<br \\/>J