(2, 'Civic', 'سيفيك', 'structure/cars/thumbs/civic_small.png', 'SIMPLY STUNNING', 'Forty years from the introduction of the first Honda Civic, the all-new Civic sets an all-new standard in compact car style and performance. With sleek, sporty lines and an improved power-to-weight ratio, it’s a driver’s delight. Your passengers will love it, too, because the spacious cabin is loaded with premium features for class-above comfort and convenience. The 2017 Civic – it’s all new, and quite simply stunning.', 'EXPLORE HONDA CIVIC<br />VIDEOS', 'check out latest videos of honda civic, features and news', 'ببساطة مذهلة', 'Forty years from the introduction of the first Honda Civic, the all-new Civic sets an all-new standard in compact car style and performance. With sleek, sporty lines and an improved power-to-weight ratio, it’s a driver’s delight. Your passengers will love it, too, because the spacious cabin is loaded with premium features for class-above comfort and convenience. The 2017 Civic – it’s all new, and quite simply stunning.', 'إكتشف فديوهات<br />هوندا سيفيك', 'شاهد أحدث فيديوهات هوندا سيفيك ، المميزات ، واخر الأخبار', 'structure/cars/logos/4645644.png', 'No', '2021-03-16 17:04:46', '2021-03-24 17:04:05', NULL),
(4, 'CRV', 'سي أر في', 'mostafa/vILttUyg8QlAgUxcwWnAzEdw8WwwTuUJQ2aZ4WqT.png', 'THE BAR HAS BEEN RAISED, AGAIN', 'The vehicle that defined a category now redefines what a compact sport-utility\r\nvehicle can be. Introducing the completely redesigned and reengineered Honda\r\nCR-V: delivering a wealth of standard features with driver and passenger conveniences.\r\nWelcome to the new standard in comfort, style and versatility.', 'EXPLORE HONDA CRV<br />VIDEOS', 'check out latest videos of honda crv, features and news', 'رفع مستوى التحدي مره اخرى', 'The vehicle that defined a category now redefines what a compact sport-utility\r\nvehicle can be. Introducing the completely redesigned and reengineered Honda\r\nCR-V: delivering a wealth of standard features with driver and passenger conveniences.\r\nWelcome to the new standard in comfort, style and versatility.', 'إكتشف فديوهات<br />هوندا سي أر في', 'شاهد أحدث فيديوهات هوندا سي أر في، المميزات ، واخر الأخبار', 'structure/cars/logos/JK34uInZNnqd2ndzgRDhSKHyckcnIwr1RK3mR7GY.png', 'No', '2021-03-16 17:04:46', '2021-03-23 03:57:41', NULL),
(5, 'City', 'سيتي', 'XfQkTIOyWv2vy5OYgJApzVmuqDpIEKJGbpueYcTb.png', 'THE BAR HAS BEEN RAISED, AGAIN', 'The vehicle that defined a category now redefines what a compact sport-utility\nvehicle can be. Introducing the completely redesigned and reengineered Honda\nCITY: delivering a wealth of standard features with driver and passenger conveniences.\nWelcome to the new standard in comfort, style and versatility.', 'EXPLORE HONDA City<br />VIDEOS', 'check out latest videos of honda crv, features and news', 'رفع مستوى التحدي مره اخرى', 'The vehicle that defined a category now redefines what a compact sport-utility\nvehicle can be. Introducing the completely redesigned and reengineered Honda\nCITY: delivering a wealth of standard features with driver and passenger conveniences.\nWelcome to the new standard in comfort, style and versatility.', 'إكتشف فديوهات<br />هوندا سيتي', 'شاهد أحدث فيديوهات هوندا سيتي، المميزات ، واخر الأخبار', '3KulsRn8MfVTTd3UtjXGDIESL0UEytvT5d6NCf2N.png', 'No', '2021-03-16 17:04:46', '2021-03-23 03:04:46', NULL),
