INSERT INTO `pages` (`id`, `static_pages`, `static_pages2`, `about_en_name`, `about_ar_name`, `about_en_details`, `about_ar_details`, `en_ceo`, `ar_ceo`, `en_environment`, `ar_environment`, `environment_videmo_id`, `additional_environment`, `motors_en_details`, `motors_ar_details`, `sort_order`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Edit static pages', 'All', 'We are a company built on dreams', 'لقد قامت شركتنا على الأحلام', 'And these dreams inspire us to create innovative products that enhance human mobility and benefit society. We see \"The Power of Dreams\" as a way of thinking that guides us and inspires us to move forward. The strength of our company comes from this philosophy—based on the visionary principles of our founder, Soichiro Honda.\n“Wouldn’t it be exciting if dream products really existed?” “We can please many people if we create the products of their dreams!” At Honda we take on challenges in developing new products and technologies while cherishing the dreams and passion of each associate to create exciting and fun products that will bring joy to many people. Dreams are the source of our courage and energy to meet every challenge without fear of failure. Dreams are the major force that propels Honda. Through The Power of Dreams, Honda will continue providing new joys to the world', 'وتلهمنا هذه الأحلام لإيجاد المنتجات الابتكارية التي تعزز الحركة البشرية وتفيد المجتمع. ونحن نرى \"قوة الأحلام\" كسبيل التفكير الذي يوجهنا ويلهمنا للتقدم للأمام. وتأتي قوة شركتنا من هذه الفلسفة، استناداً إلى المبادئ التصويرية لمؤسسنا، سويشيرو هوندا.\nألن يكون من المثير أن نجلب منتجات الأحلام إلى الواقع؟ \"إن بإمكاننا إسعاد العديد من الأشخاص إذا أوجدنا منتجات أحلامنا!\" ونحن في هوندا، نتولى التحدي الخاص بتطوير المنتجات والتقنيات الجديدة، مع إثراء أحلام وعواطف كل شريك لإيجاد المنتجات المثيرة والمرحة التي ستسعد العديد من الأشخاص. والأحلام هي مصدر شجاعتنا وطاقتنا لتلبية كل تحدي دون الخوف من الفشل. والأحلام هي أيضاً القوة الأساسية التي تحفز شركة هوندا. ومن خلال قوة الأحلام، ستستمر هوندا في تقديم أوجه الراحة الجديدة إلى العالم.', '<div class=\"ceo_set\">\r\n    <div class=\"ceo_msg_set\">\r\n        <div class=\"msg\"><img style=\"float: left; margin: 20px;\" src=\"/storage/photos/1/605d8b35e4fbc.png\" alt=\"\"\r\n                width=\"150\" height=\"150\" />Sharing joys with people around the world Ever since the foundation of our\r\n            company, Honda associates have been demonstrating a challenging spirit, wanting to bring joy to people,\r\n            contribute to society with our technologies and create new products that people have never seen anywhere in\r\n            the world. With such a challenging spirit, we have been consistently pursuing the development of\r\n            technologies that are useful to people in their daily lives and products that please our customers. In\r\n            recent years, our business environment has been marked by significant changes, including the transformation\r\n            of the global economy and market structure as well as acceleration of environmental initiatives on a global\r\n            basis. Facing such changes squarely, Honda has been strengthening and optimizing its global business\r\n            operations in order to deliver good products with speed, affordability and low CO2 emissions to our\r\n            customers in every region around the world. We will continue enhancing our unique corporate culture and\r\n            pursue our uninterrupted challenge to share joys with people around the world through technologies, products\r\n            and corporate activities unique to Honda.</div>\r\n        <div class=\"msg\">&nbsp;</div>\r\n        <div class=\"pos\">Takanobu Ito, President, CEO and Representative Director<br />June 2013</div>\r\n    </div>\r\n</div>\r\n        <section class=\"under_box\">\r\n            <div class=\"ceo_set last\">\r\n                <div class=\"ceo_msg_set\">\r\n                    <div class=\"msg\"><img style=\"margin: 20px; float: left;\" src=\"/storage/photos/1/605d8beb468a1.png\"\r\n                            alt=\"\" width=\"150\" height=\"150\" /></div>\r\n                    <div class=\"msg\">We, at Al-Futtaim, are dedicated to supplying Honda products of the highest\r\n                        quality, yet at a reasonable price for global Customer satisfaction. We live by our company\r\n                        mission statement of: \"Together we strive to be an outstanding Company achieving Customers for\r\n                        Life&rdquo;.<br />This is built around six key values: to be welcoming, trustworthy, respectful,\r\n                        innovative, inspiring and ambitious. These core value are the basis upon which we have built and\r\n                        continue to build, such a successful business.</div>\r\n                    <div class=\"msg\">&nbsp;</div>\r\n                    <div class=\"pos\">Sherif Mahmoud<br />General Manager</div>\r\n                </div>\r\n            </div>\r\n        </section>', '<p>aaa</p>', 'In 2010, Honda announced its direction for the decade leading up to 2020: to provide \"good products to customers with speed, affordability, and low CO2 emissions.\"\r\nThe Honda Environmental and Safety Vision - to realize \"the joy and freedom of mobility and a sustainable society where people can enjoy life\" - was established based on this direction.\r\nProviding the joy and freedom of mobility has been Honda\'s aim in the development of personal mobility products since the company\'s founding. The joy of mobility is not just t he pleasure of driving your own car or motorcycle.\r\nIt\'s also the excitement of making discoveries and realizing dreams through the freedom mobility provides. Realizing a sustainable society where people can enjoy life, on the other hand, will require us to focus corporate resources on addressing climate change and energy issues as top priorities.To realize the two components of our Environmental and Safety Vision, we will lead the industry in offering outstanding environmental and safety performance with products and technologies that proudly bear Honda\'s identity.', '<p>aa</p>', '76534683', NULL, 'English content *', 'Arabic content *', 1, '2021-03-26 06:21:03', '2021-03-28 13:27:51', NULL);

